import './App.css';
import Item from './components/Item';
import React, { useEffect }  from 'react'
import { useState } from 'react' 

function App() {

  const [title, setTitle] = useState("")

  useEffect(() => {
    const url = "https://jsonplaceholder.typicode.com/users"
    const fetchData = async () => {
        try {
            const response = await fetch(url);
            const json = await response.json();
            setTitle(json)
            console.log(json);
            } catch (error) {
            console.log("error", error);
            }
    };

    fetchData();
}, []);

  return (
    <div className="container my-5">
      {/* <Item title={title}/> */}
       {/* {json && json.map((Item) => ( */}
       <div className="card">
                    <div className="card-body d-flex justify-content-around">
                        <p className="card-title d-inline my-5">{title}</p>
                        <li className="list-group-item d-flex justify-content-between align-items-start">
                            <div className="ms-2 me-auto">
                                <div className="fw-bold">Contact</div>
                                <div className='mt-4'>Content for list item</div>
                            </div>
                        </li>
                        <li className="list-group-item d-flex justify-content-between align-items-start">
                            <div className="ms-2 me-auto">
                                <div className="fw-bold">City</div>
                                <div className='mt-4'>Content for list item</div>
                            </div>
                        </li>
                        <li className="list-group-item d-flex justify-content-between align-items-start">
                            <div className="ms-2 me-auto">
                                <div className="fw-bold">State</div>
                                <div className='mt-4'>Content for list item</div>
                            </div>
                        </li>

                        <p className='d-inline'>
                            <button className="btn btn-danger mt-5 btn-sm" type="button" data-bs-toggle="collapse" data-bs-target="#collapseExample" aria-expanded="false" aria-controls="collapseExample">
                                View Details
                            </button>
                        </p>

                        {/* <p className="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p> */}
                        {/* <p className="card-text"><small className="text-muted">Last updated 3 mins ago</small></p> */}
                    </div>
                    <div className="collapse" id="collapseExample">
                        <div className="card card-body mx-5 my-3">
                            Some placeholder content for the collapse component. This panel is hidden by default but revealed when the user activates the relevant trigger.
                        </div>
                    </div>
                </div >
            {/* ))} */}
    </div>
  );
}

export default App;
